double posX = 1, posY = 15;  //x and y start position
int endX = 19, endY = 0;
double ang  = -M_PI;
double planeAng = -M_PI/2;

int buffer[screenHeight][screenWidth];
int texture[8][texWidth * texHeight];
int lineClear[320][2];
int WALL_GAP = 5;

double Time = 0; //time of current frame
double oldTime = 0; //time of previous frame

/*Global base pointers*/
volatile int pixel_buffer_start;
volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
volatile int* interrupt = (int *)0xFFFEC60C;
volatile int* PS2_keyb_ptr = (int *) PS2_KEYBOARD_BASE;

bool texturesON = false;

int main(void)
{
	drawTexture();
	*(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the back buffer
	
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
	
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    wait_for_vsync();
	
	/* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
	
	//clear_screen();
	
	mode = start;
	
    while(true){
		switch(mode){
			case start:
				draw_start_screen();
				pressedKeyforMode = *PS2_keyb_ptr;
				start_screen_animation();
				
				if( pressedKeyforMode == space){
				mode = maze;
				
				Time = clock();
				draw_background();
				}
				
				break;
			
			case maze:
				pressedKeyforMode = *PS2_keyb_ptr;
				if(pressedKeyforMode == S){
					mode = settings;
					
				}else{
				oldTime = Time;
				Time = clock();

				double frameTime = (Time - oldTime) / 1000.0;
		
				double moveSpeed = 0.1; //the constant value is in squares/second
    			double rotSpeed = frameTime * 5; //the constant value is in radians/second
					
				line_clear();
	    		drawRays();
				wait_for_vsync();
				read_from_keyboard( moveSpeed, rotSpeed );
					
				wait_for_vsync();
				*(pixel_ctrl_ptr + 1) = 0xC0000000;
				pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
				if((int)posX == endX && (int)posY == endY){
					clear_screen();
					mode = win;
				}
				}
				break;
				
			case settings:
				pressedKeyforMode = *PS2_keyb_ptr;
				if(pressedKeyforMode != esc){
				draw_setting_screen();
					if(pressedKeyforMode == T){
						texturesON = !texturesON;
						if(WALL_GAP == 5) WALL_GAP = 1;
						else if(WALL_GAP == 1) WALL_GAP = 5;
						mode = maze;
						draw_background();
					}
				}else{
				mode = maze;
				draw_background();
				}
				break;
				
			case win:
				posX = 1;
				posY = 15;
				pressedKeyforMode = *PS2_keyb_ptr;
				if(pressedKeyforMode != enter){
					draw_end_screen();
					end_screen_animation();
				}else{
				mode = start;
				clear_screen();
				}
		}
	}
}

void drawRays()
{
	for(int x = 0; x < screenWidth; x+=WALL_GAP)
    {
      double cameraX = 2 * x / (double)screenWidth - 1; //x-coordinate in camera space
      double rayDirX = cos(ang) + cos(planeAng) * cameraX;
      double rayDirY = sin(ang) + sin(planeAng) * cameraX;
      //which box of the map we're in
      int mapX = (int)(posX);
      int mapY = (int)(posY);

      //length of ray from current position to next x or y-side
      double sideDistX;
      double sideDistY;

       //length of ray from one x or y-side to next x or y-side
      double deltaDistX = ABS(1 / rayDirX);
      double deltaDistY = ABS(1 / rayDirY);
      double perpWallDist;

      //what direction to step in x or y-direction (either +1 or -1)
      int stepX;
      int stepY;

      int hit = 0; //was there a wall hit?
      int side; //was a NS or a EW wall hit?
      //calculate step and initial sideDist
      if(rayDirX < 0)
      {
        stepX = -1;
        sideDistX = (posX - mapX) * deltaDistX;
      }
      else
      {
        stepX = 1;
        sideDistX = (mapX + 1.0 - posX) * deltaDistX;
      }
      if(rayDirY < 0)
      {
        stepY = -1;
        sideDistY = (posY - mapY) * deltaDistY;
      }
      else
      {
        stepY = 1;
        sideDistY = (mapY + 1.0 - posY) * deltaDistY;
      }
		
      //perform DDA
		
      while (hit == 0)
      {
        //jump to next map square, OR in x-direction, OR in y-direction
        if(sideDistX < sideDistY)
        {
          sideDistX += deltaDistX;
          mapX += stepX;
          side = 0;
        }
        else
        {
          sideDistY += deltaDistY;
          mapY += stepY;
          side = 1;
        }
        //Check if ray has hit a wall
        if(worldMap[mapX][mapY] > 0) hit = 1;
		if(mapX >= mapWidth || mapX < 0) break;
		if(mapY >= mapHeight || mapY < 0) break;
      }
	  if(mapX >= mapWidth || mapX < 0 ||
		 mapY >= mapHeight || mapY < 0){
		  lineClear[x][0] = 0;
		  lineClear[x][1] = 0;
		  continue;
	  }
      //Calculate distance projected on camera direction (Euclidean distance will give fisheye effect!)
      if(side == 0) perpWallDist = (mapX - posX + (1 - stepX) / 2) / rayDirX;
	  else perpWallDist = (mapY - posY + (1 - stepY) / 2) / rayDirY;

      //Calculate height of line to draw on screen
      int lineHeight = (int)(screenHeight / perpWallDist);

      //calculate lowest and highest pixel to fill in current stripe
      int drawStart = -lineHeight / 2 + screenHeight / 2;
      if(drawStart < 0)drawStart = 0;
      int drawEnd = lineHeight / 2 + screenHeight / 2;
      if(drawEnd >= screenHeight)drawEnd = screenHeight - 1;

      //choose wall color
	  if(!texturesON)
	  {
		  short int color;
		  switch(worldMap[mapX][mapY])
		  {
			case 1:  color = BLACK;  break; //red
			case 2:  color = RED;  break; //green
			default: color = ORANGE; break; //yellow
		  }

		  verLine(x, drawStart, drawEnd - drawStart, color);
	  }	
	  else if(texturesON){
		  int texNum = worldMap[mapX][mapY] - 1; //1 subtracted from it so that texture 0 can be used!

		  //calculate value of wallX
		  double wallX; //where exactly the wall was hit
		  if(side == 0) wallX = posY + perpWallDist * rayDirY;
		  else          wallX = posX + perpWallDist * rayDirX;
		  wallX -= floor((wallX));

		  //x coordinate on the texture
		  int texX = (int)(wallX * (double)(texWidth));
		  if(side == 0 && rayDirX > 0) texX = texWidth - texX - 1;
		  if(side == 1 && rayDirY < 0) texX = texWidth - texX - 1;

		  // TODO: an integer-only bresenham or DDA like algorithm could make the texture coordinate stepping faster
		  // How much to increase the texture coordinate per screen pixel
		  double step = 1.0 * texHeight / lineHeight;
		  // Starting texture coordinate
		  double texPos = (drawStart - screenHeight / 2 + lineHeight / 2) * step;
		  for(int y = drawStart; y < drawEnd; y++)
		  {
			// Cast the texture coordinate to integer, and mask with (texHeight - 1) in case of overflow
			int texY = (int)texPos & (texHeight - 1);
			texPos += step;
			int color = texture[texNum][texHeight * texY + texX];
			//make color darker for y-sides: R, G and B byte each divided through two with a "shift" and an "and"
			if(side == 1) color = (color >> 1) & 8355711;
			plot_pixel(x, y, color);
		  }
	  }
		
	  lineClear[x][0] = drawStart;
	  lineClear[x][1] = drawEnd;
    }
}


void clear_screen () {
    for (int x = 0; x < 320; x++) {
        for (int y = 0; y < 240; y++) {
            plot_pixel(x, y, BLACK);
        }
    }
}

void verLine(int x0, int y0,int dimy, short int line_color) {
	for (int y = y0; y < y0+dimy; y++) {
		plot_pixel(x0, y, line_color);
	}
}	

void get_keyboard_input(){
	pressedKey = *PS2_keyb_ptr;
}

void read_from_keyboard(double moveSpeed, double rotSpeed ){
	//*PS2_keyb_ptr = 0xff;

	/*while(!(*PS2_keyb_ptr & 0x8000)){
		//*(PS2_keyb_ptr) = 0xF4; //initialize sending of data
	}*/	
	
	pressedKey = *PS2_keyb_ptr;
	
	if(pressedKey == upArrow )
	{
		if(worldMap[(int)(posX + cos(ang) * moveSpeed)][(int)(posY)] != 1 ) posX += cos(ang) * moveSpeed;
		if(worldMap[(int)(posX)][(int)(posY + sin(ang) * moveSpeed)] != 1 ) posY += sin(ang) * moveSpeed;
	}
	else if(pressedKey == downArrow )
	{
		if(worldMap[(int)(posX - cos(ang) * moveSpeed)][(int)(posY)] != 1 ) posX -= cos(ang) * moveSpeed;
		if(worldMap[(int)(posX)][(int)(posY - sin(ang) * moveSpeed)] != 1 ) posY -= sin(ang) * moveSpeed;
	}
	else if(pressedKey == rightArrow )
	{
		//both camera direction and camera plane must be rotated
		ang += rotSpeed;
		planeAng += rotSpeed;
	}
	//rotate to the left
	else if(pressedKey == leftArrow )
	{
		//both camera direction and camera plane must be rotated
		ang -= rotSpeed;
		planeAng -= rotSpeed;
		
	}
}

void wait_for_vsync(){
	*pixel_ctrl_ptr = 1;
	while ((*(pixel_ctrl_ptr + 3) & 0x01) == 1) {
    	}
}	


void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

