void wait_delay(){
	volatile int * timer_ptr = (int *) TIMER_BASE;
	*timer_ptr = 100000000;
	*(timer_ptr+2) = 1;
	while( *(timer_ptr+1) != 0 ){
		//printf("%d\n", *(timer_ptr+1));
	}
	*(timer_ptr+3) = 1;
	printf("%d", *(timer_ptr+3));

}

void draw_start_screen(){	
	for(int x = 0; x < screenWidth; x++){
		for(int y = 0; y < screenHeight; y++){
			plot_pixel(x, y, start_screen_array[y][x]);
		}
	}
	
}

void start_screen_animation(){
	for(int x = 65; x < 260; x++){
		for(int y = 180; y < 200; y++){
			if(start_screen_array[y][x] != 0){
			plot_pixel(x, y, BLACK);
			}
		}
	}
	wait_delay();
	wait_for_vsync();	
	start_screen_animation2();
}

void start_screen_animation2(){
	for(int x = 65; x < 260; x++){
		for(int y = 180; y < 200; y++){
			
			plot_pixel(x, y, start_screen_array[y][x]);
			
		}
	}
	wait_delay();
	wait_for_vsync();	
}

